import React from "react";
import { useStyles } from "./styles/style"
//material-ui
import { Grid } from '@material-ui/core'

export const Card = () => {

  const classes = useStyles()

  return (
    <Grid
      className={ classes.card }
      item
      md={6}
      xs={12}
    >
      <div
        style={{
          width: "100%",
          height: "100%",
          backgroundColor: "rgba( 0 , 120 , 34 , 1 )",
        }}
        className="container"
      ></div>
    </Grid>
  );
};
